   "source": [
    "ppred <- prediction(attributes(pred_train_nb)$prob[2, ], true_train_nb)\n",
    "ppred\n",
    "\n",
    "rroc <- performance(ppred,\"tpr\",\"fpr\")\n",
    "plot(rroc, main = \"NB Baseline ROC Curve \\n Bayes α=10\")\n",
    "abline(a=0, b=1, col = \"red\")\n",
    "\n",
    "#AUC\n",
    "auc <- performance(ppred, \"auc\")\n",
    "auc <- unlist(slot(auc,\"y.values\"))\n",
    "auc <- round(auc, 4)\n",
    "legend(.6,.4,auc, title = \"AUC\")"
   ]
